INSERT INTO [dbo].[DentistryTable] ([id], [name], [shortDesc], [longDesc], [img], [price], [isFavourite], [available], [categoryId]) VALUES (1, N'Лечение кариеса', NULL, N'Кариес - это распространенное заболевание зубов, вызванное бактериями, которые образуют кислоту из пищевых остатков в полости рта. Постепенно кислота разрушает эмаль, что приводит к образованию дефектов на поверхности зуба - кариозных полостей.', N'/img/057f48509edc9816acab9a7cf40b9723.jpg', 4300, 1, 1, 1)
INSERT INTO [dbo].[DentistryTable] ([id], [name], [shortDesc], [longDesc], [img], [price], [isFavourite], [available], [categoryId]) VALUES (2, N'Лечение Среднего кариеса', NULL, N'Средний кариес - это более продвинутая стадия заболевания зубов, где уже произошло значительное разрушение эмали и дентина. На этой стадии кариес может привести к более серьезным симптомам, таким как боли при употреблении пищи, появление чувствительности зубов к различным раздражителям, включая холодное, горячее, сладкое или кислое. Зубы могут также менять цвет из-за наличия кариозных полостей.', N'/img/057f48509edc9816acab9a7cf40b9723.jpg', 4600, 1, 1, 1)
INSERT INTO [dbo].[DentistryTable] ([id], [name], [shortDesc], [longDesc], [img], [price], [isFavourite], [available], [categoryId]) VALUES (3, N'Лечение Глубокого кариеса', N'', N'Консоль старого поколения, поддержка которой прекращена давно. Прилагается для коллекционеров и ценителей старых моделей', N'/img/junior-img-card.png', 2500, 1, 1, 1)
